import React from "react";

const Hotels=(props)=>{
    console.log('hotels',props.hotels)
    const display=props.hotels.map((place)=>{
        return(
            <div className="card">
                <div className="card-content">
                    <h1>{place.hotel_name}</h1>
                </div>
                <div className="content">
                    <div className="card-image">
                        <img src={place.main_photo_url}></img>
                    </div>
                    <div>
                        <h3>Neighborhood:{place.district}</h3>
                    </div>
                </div>
            </div>
        )
    })
    console.log('display',display)
    return(
        <React.Fragment>
            {display}
        </React.Fragment>
    )
}
export default Hotels
